export const getAllNavigate = async () => {
  React.useEffect(() => {
    fetch("/api")
      .then((res) => res.json())
      .then((data) => setData(data.message));
  }, []);
};

export const getAllProducts = () => {
  return fetch("http://localhost:3001/transport-products")
    .then((res) => res.json())
    .then((body) => body.products);
};

